/*
import React from "react"
export default function Test({firstname}) {
    return(
        <div>firstname {firstname}</div>
    )
   

}


import React, { Component } from "react";
export default class Test extends {Component}{
    render(){
        return(
        <h1>Hellow world</h1>
    )
    };
}*/
